import { creatGlobalStyle } from "styled-components";
export const GlobalStyle = creatGlobalStyle`
h1 {
    font-size: 72px;
    background: -webkit-linear-gradient(#eee, #333);
    -webkit-background-clip: text;
    -webkit-text-fill-color: transparent;
}

`;
